<!DOCTYPE html>
<html>
<head>
  <meta charset="UTF-8">
  <title>SCF Java Labs | Pyatt Labs</title>
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <link rel="stylesheet" href="https://cdn.jsdelivr.net/npm/docsify-themeable@0/dist/css/theme-simple.css">
  <style>
    .sidebar-nav li.collapse > ul {
      display: none;
    }
    .sidebar-nav li.collapse.open > ul {
      display: block;
    }
    .sidebar-nav li.collapse > a:before {
      content: '▸ ';
    }
    .sidebar-nav li.collapse.open > a:before {
      content: '▾ ';
    }
  </style>
</head>
<body>
  <div id="app"></div>
  <script>
    window.$docsify = {
      name: 'SCF Java Labs',
      repo: 'https://github.com/PyattLabs/scf-java-labs',
      loadSidebar: true,
      subMaxLevel: 2,
      sidebarDisplayLevel: 0,
      search: 'auto'
    }
  </script>
  <script src="https://cdn.jsdelivr.net/npm/docsify@4"></script>
  <script src="https://cdn.jsdelivr.net/npm/docsify@4/lib/plugins/search.min.js"></script>
  <script src="https://cdn.jsdelivr.net/npm/prismjs@1/components/prism-java.min.js"></script>
  <script src="https://cdn.jsdelivr.net/npm/docsify-sidebar-collapse/dist/docsify-sidebar-collapse.min.js"></script>
</body>
</html>
